import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.sass';
import Home from './components/Home/Home';

function App() {
  return (
    <div class="spinner-border" role="status">
  <span class="sr-only">Loading...</span>

    <Router>
        <Switch>
          <Route path="/account">
            {/* <Account /> */}
          </Route>
          <Route path="/login">
            {/* <Login /> */}
          </Route>
          <Route path="/challenge">
            {/* <Challenge /> */}
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </Router>
    </div>
  );
}

export default App;
